import { Component } from 'react';
import './App.css';
import Logo from './components/Logo';
import Search from './components/Search';
import Card from './components/Card';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      location: '',
      weather: '',
      typing: '',
    };
  }
  input = (event) => {
    this.setState({ typing: event.target.value });
  };

  render() {
    return (
      <div className="App">
        <Logo />
        <Search />
        <Card />
      </div>
    );
  }
}

export default App;
